function ShowModal(n){let t=document.getElementById(n),i=bootstrap.Modal.getOrCreateInstance(t);i.show()}function HideModal(n){let t=document.getElementById(n),i=bootstrap.Modal.getOrCreateInstance(t);i.hide()}function ShowToast(n){let t=document.getElementById(n),i=bootstrap.Toast.getOrCreateInstance(t);i.show()}function ShowToastByClass(){let n=document.querySelector(".toast"),t=bootstrap.Toast.getOrCreateInstance(n);t.show()}function FocusOnElement(n){document.getElementById(n).focus()}function Debug(n){console.log(n)}